	public static Map creven(String xmlRequest) {
		
		// สร้าง RestTemplate instance
        RestTemplate restTemplate = new RestTemplate();
        ObjectMapper objectMapper = new ObjectMapper();
        
        // URL ของ API ที่ต้องการส่ง request ไป
        String url = "http://localhost:8082/api/esb/producers";
        
        // สร้าง HttpHeaders และกำหนด Content-Type ให้เป็น application/xml
        HttpHeaders headers = new HttpHeaders();
        headers.setContentType(MediaType.APPLICATION_XML);
        
        // สร้าง HttpEntity ที่ประกอบด้วย XML และ Headers
        HttpEntity<String> requestEntity = new HttpEntity<>(xmlRequest, headers);
        ResponseEntity<Map> responseEntity = null;
        
        try {
        	responseEntity = restTemplate.exchange(url, HttpMethod.POST, requestEntity, Map.class);
            System.out.println("Response: " + objectMapper.writeValueAsString(responseEntity.getBody()));
        } catch (Exception e) {
        	e.printStackTrace();        	
        }
        
		return responseEntity.getBody();
	}
	
